import React from "react";

import { useHistory } from 'react-router-dom';
import ButtonTrird from "../buttons/button3";
import { Button, ButtonContainer, HeaderContainer } from "./styles";

// https://youtu.be/AXKc4WhgLSA - criar header com typeScript

const Header: React.FC = () => {

  const history = useHistory();
  const handleClick = () => {
    history.push('/entrar')
  }  

  return (
<HeaderContainer>
  <h1 className="header-logo">** Agenda Aniversariantes **</h1>
  <ButtonContainer>  
<ButtonTrird name={"Top"} />
<ButtonTrird />
<ButtonTrird />
<ButtonTrird />
  </ButtonContainer>  
</HeaderContainer>
  )
}

export default Header
